import React from "react";
import NavBar from "./NavBar";
import Intro from "./Intro";
import Shorten from "./Shorten";
import Stat from "./Stat";
import BoostBox from "./BoostBox";
import Footer from "./Footer";

function App() {
  return (
    <div className="App">
      <NavBar />
      {/* <Intro /> */}
      <Shorten />
      <Stat />
      <BoostBox />
      <Footer />
    </div>
  );
}

export default App;
